import React from "react";
import { Button, Container, Segment } from "semantic-ui-react";

export const Fronti = () => {
  return (
    <Segment  tertiary clearing>
      <Button floated="right" content="Ndrysho" color="black"></Button>
        <h3 style={{position:'absolute',marginBottom:'30px'}}>Hello</h3>
    </Segment>
  );
};
